ues])\n    print(\"explained_variance ,singular_values\", cpt , flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1058","type":"WheelZoomTool"},{"attributes":{"data":{"bandwidth":[1238168718.9780807],"bandwidth-half":[619084359.4890404],"bandwidth_text":["1.15 GiB"],"type":["numpy.ndarray"]},"selected":{"id":"1509"},"selection_policy":{"id":"1508"}},"id":"1181","type":"ColumnDataSource"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_alpha":{"value":0.2},"line_color":{"field":"bandwidth","transform":{"id":"1151"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1173","type":"Rect"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1178","type":"AdaptiveTicker"},{"attributes":{"days":[1,8,15,22]},"id":"1517","type":"DaysTicker"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Name:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@name&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Filename:&lt;/span&gt;&amp;nbsp;\n                &lt;span style=\"font-size: 10px; font-family: Monaco, monospace;\"&gt;@filename&lt;/span&gt;\n            &lt;/div&gt;\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;Line number:&lt;/span&gt;&amp;nbsp;\n
